VALUES ('5060521680797', 'INNOVIT', 'carbonate de calcium, oxyde de magnésium, cellulose microcristalline, acide ascorbique, gomme d\'acacia, fumarate de fer, maltodextrine, hydroxypropylméthylcellulose, carboxyméthylcellulose de sodium réticulée, acétate de DL-alpha-tocophéryl, nicotinamide, amidon de maïs modifié, oxyde de zinc, pantothénate de calcium, colorant (dioxyde de titane), stéarate de magnésium, antiagglomérant (dioxyde de silicium), talc, humectant (glycérol), sulfate de cuivre pentahydraté, sucrose, sulfate de manganèse monohydraté, amidon de maïs, chlorhydrate de pyridoxine,chlorhydrate de thiamine, riboflavine, acétate de rétinyle, acide folique, iodure de potassium, chlorure de chrome hexahydraté, DL-alpha-tocophérol, dioxyde de silicium, sélénite de sodium, molybdate de sodium dihydraté, phytoménadione, biotine, cholécalciférol, cyanocobalamine. Important: Ne pas utiliser si l\'emballage intérieur est endommagé. Tenir hors de la vue et de la portée des enfants. Les compléments alimentaires ne doivent pas être utilisés comme substitut d\'un régime alimentaire varié et d\'un mode de vie sain. Ce produit contient de la vitamine A : ne pas le prendre si vous êtes enceinte, si vous prévoyez de le devenir, sauf indication contraire. Contient du fer, qui, si pris en excès, peut être dangereux pour les jeunes enfants. Ce complément alimentaire ne convient pas aux enfants de moins de 3 ans. Ne convient pas aux personnes sous traitement anticoagulant coumarinique. Conserver dans un endroit frais et sec, ne dépassant pas 25°C.', 'https://static.openfoodfacts.org/images/products/506/052/168/0797/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

